import React from 'react';
import { Box, Typography } from '@mui/material';

const Footer = () => {
  return (
    <Box 
      sx={{
        position: 'absolute',
        bottom: 0,
        width: '100%',
        textAlign: 'center',
        padding: '10px 0',
        backgroundColor: '#f8f9fa',
        boxShadow: '0 -2px 5px rgba(0, 0, 0, 0.1)',
        fontSize: '14px',
      }}
    >
      <Typography variant="body2">
        Author: Peeradol Thanyatheeraphong, Computer Engineering student at KKU.
      </Typography>
    </Box>
  );
};

export default Footer;
